import React from 'react';
import {Card, OverlayTrigger, Button} from 'react-bootstrap'


export default class Resources extends React.Component {
    constructor(props) {
        super(props);
    }
    render() {
        const Resource = (
            <Card style={{width:250, height: 250}}className="bg-light text-white">
                <Card.Img src= {this.props.imgsrc} alt="Card image" />
                <Card.ImgOverlay>
                    <Card.Title>{this.props.title}</Card.Title>
                    <Card.Text>
                    {this.props.info}
                    </Card.Text>
                </Card.ImgOverlay>
            </Card>
        );
        return (
        <OverlayTrigger trigger="hover" placement="auto" overlay={Resource}>
            <Card>
            <Card.Img src= {this.props.imgsrc} alt="Card image" />
            </Card>
        </OverlayTrigger>

        );
    }
}
